import React from 'react'
import './Chat.css'
import { Avatar } from '@material-ui/core'
import SearchIcon from '@material-ui/icons/Search';
import MoreVertIcon from '@material-ui/icons/MoreVert';

function Chat() {
  return (
    <div classname="chat">

      <div className="chat_header">
        <Avatar />
        <SearchIcon />
        <MoreVertIcon />
      </div>
    </div>
  )
}

export default Chat
